window.downloadFile=function(a){if(window.downloadFile.isChrome||window.downloadFile.isSafari){var b=document.createElement("a");b.href=a;if(b.download!==undefined){var c=a.substring(a.lastIndexOf("/")+1,a.length);b.download=c}if(document.createEvent){var d=document.createEvent("MouseEvents");return d.initEvent("click",!0,!0),b.dispatchEvent(d),!0}}var e="?download";window.open(a+e)},window.downloadFile.isChrome=navigator.userAgent.toLowerCase().indexOf("chrome")>-1,window.downloadFile.isSafari=navigator.userAgent.toLowerCase().indexOf("safari")>-1